import React from 'react';
import { Row, Col} from 'react-bootstrap';
import { Link } from 'react-router-dom';

const ShowExpedients = props => {
	return (
		<Row>
            {props.expedientes.map( expediente => (
                <Col key={expediente.id} md={props.vista ? 12 : 3}>
                    <div className="shadow p-3 bg-white rounded">
                        <Link to="/detail/123" className="text-center">
                            <b>{expediente.nombre}</b>
                        </Link>
                    </div>
                </Col>
            ))}
    	</Row>
	);
}

export default ShowExpedients;
